import React from "react";
import Test from "./components/Test/test";

import './App.css';

class Main extends React.Component{
    constructor(props) {
        super(props);

    }
    render() {
        const users = [{name: 'test1'}, {name: 'test1'}, {name: 'test1'}, ];
        return (
            <div>
                {users?.map((user) => 
                    <Test
                        user={user}
                    />
                )}

            </div>
        )
    }
}

export default Main;
